import React from "react";

function ParkPhoto() {
    return (
        <div className="card">
            <div className="card-header">
                <h3 className="card-title">Photo of Park</h3>
            </div>

            <div className="card-body">
                <p className="card-text">
                </p>
            </div>
        </div>

    );
}
export default ParkPhoto;
